    n = input()
    # Read in the guess
    g = input()
    # Initialize the number of cows and bulls
    cows = 0
    bulls = 0
    # Loop through each digit
    for i in range(4):
        # Check if the digits are the same
        if n[i] == g[i]:
            # If so, increment the number of bulls
